package com.mloftus.mastermind;

public class MastermindMessages {

	public static void printUsageMessage() {
		System.out.println("Usage:  java MastermindGame <codeLength>");
		System.out.println("Valid code lengths are numbers from 3 to 6");
	}
	
	public static void printWelcomeMessage(Integer codeLength, Integer maxGuesses) {
		System.out.println("Welcome to Mastermind.");
		System.out.println(String.format("Your secret code is %s digits in length.  You have %s guesses.  Good luck!\n", codeLength, maxGuesses));
	}

	public static void printGuessHelpStatement(Integer codeLength) {
		System.out.println(String.format("Your guess must be a %s digit number with no duplicate digits.", codeLength));
	}

	public static void printWinningStatement(Integer numberOfGuesses, String gameCode) {
		System.out.println(String.format("You win!!  %s guesses.  Code is: %s", numberOfGuesses, gameCode));
	}

	public static void printGuessResultStatement(Integer digitMatches, Integer LocationMatches) {
		System.out.println(String.format("%s correct digits.  %s correct locations.\n", digitMatches, LocationMatches));
	}

	public static void printGameOverStatement(String gameCode) {
		System.out.println(String.format("Out of guesses.  Game over.  Code is %s", gameCode));
	}
}

package com.mloftus.mastermind;

import java.util.*;

public class MastermindLogic {

	private List<Integer> code;
	private List<Integer> guess;
	private MastermindGuessValidator guessValidator;
	
	public MastermindLogic() {
		
	}
	
	public MastermindLogic(Integer codeLength) {
		generateCode(codeLength);
		guessValidator = new MastermindGuessValidator(codeLength);
	}

	public void generateCode(int codeLength) {
		this.code = new ArrayList<Integer>(codeLength);
		while (this.code.size() < codeLength){
			Random random = new Random();
			int randomNumber = random.nextInt(9 - 1) + 1;
			if (! this.code.contains(randomNumber)) {
				this.code.add(randomNumber);
			}
		}
	}

	public void setCode(String code) {
		this.code = convertStringToArrayList(code);
	}

	public boolean guessIsValid(String guess) {
		return guessValidator.guessIsValid(guess);
	}

	public boolean guessMatchesCode(String myGuess) {
		this.guess = convertStringToArrayList(myGuess);
		return (getDigitMatches() == code.size() && getLocationMatches() == code.size());
	}

	private List<Integer> convertStringToArrayList(String inString) {
		List<Integer> result = new ArrayList<Integer>(inString.length());
		for (int i=0;i<inString.length();i++){
			result.add(Integer.parseInt(inString.substring(i, i+1)));
		}
		return result;
	}
	
	public String getCode() {
		return String.format("%s%s%s%s", code.toArray());
	}

	public int getDigitMatches() {
		int matches = 0;
		for (Integer codeDigit : code) {
			for (Integer guessDigit : guess) {
				if (codeDigit == guessDigit)
					matches++;
			}
		}
		return matches;
	}

	public int getLocationMatches() {
		int matches = 0;
		for (int i=0;i<code.size();i++) {
			if(guess.get(i) == code.get(i))
				matches++;
		}
		return matches;
	}

}

package com.mloftus.mastermind;

public class MastermindGuessValidator {
	
	private int codeLength;

	public MastermindGuessValidator(int codeLength) {
		this.codeLength = codeLength;
	}

	public boolean guessIsValid(String guess) {
		return lengthIsCorrect(guess, codeLength) && isNumeric(guess) && hasNoRepeatDigits(guess);
	}

	private boolean lengthIsCorrect(String guess, int codeLength) {
		return guess.length() == codeLength;
	}

	private boolean isNumeric(String guess) {
		char[] guessChars = guess.toCharArray();
		for(char digitChar : guessChars){
			try {
				Integer.parseInt(String.valueOf(digitChar));
			} catch (NumberFormatException e) {
				return false;
			}
		}
		return true;
	}

	private boolean hasNoRepeatDigits(String guess) {
		char[] charsInGuess = guess.toCharArray();
		char[] checkedChars = new char[guess.length()];
		for (int i=0;i<charsInGuess.length;i++){
			for (char checked : checkedChars) {
				if (checked == charsInGuess[i])
					return false;
			}
			checkedChars[i] = charsInGuess[i];
		}
		return true;
	}

}

package com.mloftus.mastermind;

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;

import javax.naming.ConfigurationException;

public class MastermindGame {

	private Integer codeLength = 4;
	private Integer maxGuesses = 10;
	private MastermindLogic game;
	private Integer numberOfGuesses = 0;
	
	public MastermindGame(int codeLength) {
		this.codeLength = codeLength;
	}

	public void play() throws ConfigurationException {

		configureGame();
		
		MastermindMessages.printWelcomeMessage(codeLength, maxGuesses);
		
		while (someGuessesRemain()) {
			askForNextGuess();
			String guess = getGuess();
			if (guessNotValid(guess)) {
				MastermindMessages.printGuessHelpStatement(codeLength);
				continue;
			}
			numberOfGuesses++;
			if (isWinningGuess(guess)) {
				MastermindMessages.printWinningStatement(numberOfGuesses, game.getCode());
				break;
			} else {
				MastermindMessages.printGuessResultStatement(game.getDigitMatches(), game.getLocationMatches());
			}

		}
		if (ranOutOfGuesses()) {
			MastermindMessages.printGameOverStatement(game.getCode());
		}

	}

	private void configureGame() throws ConfigurationException {
		if (codeLength < 3 || codeLength > 6) {
			throw new ConfigurationException("Code length not valid.");
		}
		if (codeLength > 4) {
			maxGuesses = 15;
		}
		game = new MastermindLogic(codeLength);
	}
	
	private boolean someGuessesRemain() {
		return numberOfGuesses  < maxGuesses;
	}

	private void askForNextGuess() {
		System.out.print(String.format("Your guess? (%s left):", (maxGuesses - numberOfGuesses)));
	}

	private String getGuess() {
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		String guess = null;
		try {
			guess = br.readLine();
		} catch (IOException e) {
			e.printStackTrace();
		}
		return guess;
	}
	
	private boolean guessNotValid(String guess) {
		return ! game.guessIsValid(guess);
	}

	private boolean isWinningGuess(String guess) {
		return game.guessMatchesCode(guess);
	}

	private boolean ranOutOfGuesses() {
		return ! someGuessesRemain();
	}

	public static void printUsageMessage() {
		MastermindMessages.printUsageMessage();
	}

}
